// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;
import "./Organisation.sol";
import "./Student.sol";
import "./Company.sol";
import "./OverAll.sol";

contract HelperOrg {
    struct organisation {
        string name;
        address addr;
        // uint256 noOfStudents;
    }

    function checkOrganisation(Organisation[] memory organisations)
        public
        view
        returns (string memory)
    {
        for (uint256 i = 0; i < organisations.length; i++) {
            if (organisations[i].organisationAddress() == msg.sender) {
                return organisations[i].organisationName();
            }
        }
        return "no";
    }

    function getOrganisation(
        Organisation[] memory Orgaganisations,
        address _orgAddress
    ) public view returns (Organisation) {
        for (uint256 i = 0; i < Orgaganisations.length; i++) {
            if (Orgaganisations[i].organisationAddress() == msg.sender) {
                return Orgaganisations[i];
            }
        }
    }

    function totalCertificates(Organisation org) public view returns (uint256) {
        uint256 total = 0;
        for (uint256 i = 0; i < org.noOfStudents(); i++) {
            total += org.students(i).noOfCertificates();
        }
        return total;
    }

    function getOrganisationDetails(
        Organisation[] memory Orgaganisations,
        address add
    )
        public
        view
        returns (
            string memory,
            address,
            uint256,
            uint256,
            uint256
        )
    {
        Organisation org = getOrganisation(Orgaganisations, add);

        return (
            org.organisationName(),
            msg.sender,
            org.noOfUniqueIds(),
            org.noOfStudents(),
            totalCertificates(org)
        );
    }
}
